  methods: {
    esaddEvent(id, relationId) {
      const mapConfig = this.$data.mapConfig;
      const parentComponent = this.$parent;
      const _obj = $("#" + id);
      const arr = id.split("");
      const _Textobj = $("#" + id + "," + "#esjsvn" + arr.slice(4).join(""));
      $("#" + ["visnames"]).attr({"fill": mapConfig.general.visibleNames});
      _obj.attr({"fill": mapConfig[id].upColor, "stroke": mapConfig.general.borderColor});
      _Textobj.attr({"cursor": "default"});
      if (mapConfig[id].active === true) {
        _Textobj.attr({"cursor": "pointer"});
        _Textobj.hover(function () {
          $("#esjstip").show().html(mapConfig[id].hover);
          _obj.css({"fill": mapConfig[id].overColor});
        }, function () {
          $("#esjstip").hide();
          $("#" + id).css({"fill": mapConfig[id].upColor});
        });
        if (mapConfig[id].target !== "none") {
          _Textobj.mousedown(function () {
            $("#" + id).css({"fill": mapConfig[id].downColor});
          });
        }
        _Textobj.mouseup(function () {
          $("#" + id).css({"fill": mapConfig[id].overColor});

          switch (mapConfig[id].target) {
            case "new_window":
              window.open(mapConfig[id].url);
              break;
            case "same_window" :
              window.parent.location.href = mapConfig[id].url;
              break;
            case mapConfig[id].target === "modal":
              $(mapConfig[id].url).modal("show");
              break;
            default:
              parentComponent.sendMessage('user', {'text': mapConfig[id].url})
              break;

          }

        });
        _Textobj.mousemove(function (e) {
          let x = e.pageX + 10, y = e.pageY + 15;
          const tipw = $("#esjstip").outerWidth(), tiph = $("#esjstip").outerHeight();
          x = (x + tipw > $(document).scrollLeft() + $(window).width()) ? x - tipw - (20 * 2) : x;
          y = (y + tiph > $(document).scrollTop() + $(window).height()) ? $(document).scrollTop() + $(window).height() - tiph - 10 : y;
          $("#esjstip").css({left: x, top: y});
        });
        if (this.isTouchEnabled()) {
          _Textobj.on("touchstart", function (e) {
            const touch = e.originalEvent.touches[0];
            let x = touch.pageX + 10, y = touch.pageY + 15;
            const tipw = $("#esjstip").outerWidth(), tiph = $("#esjstip").outerHeight();
            x = (x + tipw > $(document).scrollLeft() + $(window).width()) ? x - tipw - (20 * 2) : x;
            y = (y + tiph > $(document).scrollTop() + $(window).height()) ? $(document).scrollTop() + $(window).height() - tiph - 10 : y;
            $("#" + id).css({"fill": mapConfig[id].downColor});
            $("#esjstip").show().html(mapConfig[id].hover);
            $("#esjstip").css({left: x, top: y});
          });
          _Textobj.on("touchend", function () {
            $("#" + id).css({"fill": mapConfig[id].upColor});
            if (mapConfig[id].target === "new_window") {
              window.open(mapConfig[id].url);
            } else if (mapConfig[id].target === "same_window") {
              window.parent.location.href = mapConfig[id].url;
            } else if (mapConfig[id].target === "modal") {
              $(mapConfig[id].url).modal("show");
            }
          });
        }
      }
    },
    isTouchEnabled() {
      return (("ontouchstart" in window)
          || (navigator.MaxTouchPoints > 0)
          || (navigator.msMaxTouchPoints > 0));
    }
  },
  mounted() {
    $(() => {
      $("path[id^=esjs]").each((i, e) => {
        this.esaddEvent($(e).attr("id"));
      });
    });
  }
